script: |
  super -f text -I q10708.spq | sort > q10708.out

inputs:
  - name: q10708.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col2 * + col0 * + 58 + - col2 BETWEEN ( + col2 ) AND 64 + - col0;
  - name: tab2

outputs:
  - name: q10708.out
    data: |
      46	51	23
      64	77	40
      75	67	58
